import { Route, Switch, Redirect } from "react-router-dom";

import Layout from "./components/layout/Layout";
import AboutMe from "./pages/AboutMe";
import HomePage from "./pages/Homepage";
import NotFound from "./pages/NotFound";

const App = () => {
  return (
    <Layout>
      <Switch>
        <Route path="/" exact>
          <HomePage />
        </Route>
        <Route path="/about">
          <AboutMe />
        </Route>

        <Route path="*">
          <NotFound />
        </Route>
      </Switch>
    </Layout>
  );
};

export default App;
